import React from "react";

const product = [
  { id: 1, name: 'pr1' },
  { id: 2, name: 'pr2' },
  { id: 3, name: 'pr3' },
  { id: 4, name: 'pr4' },
];
const ProductList = () => {
  return (
    <div>
      <div className="card">
        <h2>Add-to-cart this products:</h2>
        {product.map((pr)=>{
            return (
                <div className="card-body">
          <h5 className="card-title">{pr.id}: {pr.name}</h5>
          <button className="btn btn-primary">Add-to-cart</button>
        </div>
            )
        })}
      </div>
    </div>
  );
};

export default ProductList;
